(351, 18, '{\"id\":351,\"name\":\"Has the work been published?\",\"title\":\"Has the work been published?\",\"type\":\"list\",\"information\":\"A written work is considered published if it has been provided to the public somehow, in tangible or intangible form, either for sale or for free.\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(352, 18, '{\"id\":352,\"name\":\"Is the name of the publisher known?\",\"title\":\"Is the name of the publisher known?\",\"type\":\"list\",\"information\":\"The publisher is the person or the company responsible for the printing of the written work and its distribution to the public. The name of the publisher is usually found at the bottom of the title page and/or on the verso of the publication. If no such information is available, or if the written work has been printed and distributed by its author alone, then select “No”.\",\"outputs\":[\"Yes\",\"No\"]}'),
