(358, 18, '{\"id\":358,\"name\":\"Is the name of the author known?\",\"title\":\"Is the name of the author known?\",\"type\":\"list\",\"information\":\"The author is the creator of the written work. Unless there is reason to believe differently, the author is the person whose name is indicated as the creator in or on the written work or, where there is no such indication, the person who was made known as the author when the written work was made public.\",\"outputs\":[\"Yes\",\"No\"]}'),
