(403, 19, '{\"id\":403,\"name\":\"Is the name of the composer known?\",\"title\":\"Is the name of the composer known?\",\"type\":\"list\",\"information\":\"The composer is the maker of the music, including melody, harmony, rhythm and instrumentation. Unless there is reason to believe differently, the composer is the person whose name is indicated as the creator in or on the music or, where there is no such indication, the person who was made known as the composer when the musical work was made public.\",\"outputs\":[\"Yes\",\"No\"]}'),
