(411, 19, '{\"id\":411,\"name\":\"Is the name of the lyricist known?\",\"title\":\"Is the name of the lyricist known?\",\"type\":\"list\",\"information\":\"The lyricist is the person who has written the words for the song. Unless there is reason to believe differently, the lyricist is the person whose name is indicated as the lyricist on the song or, where there is no such indication, the person who was made known as the lyricist when the song was made public.\",\"outputs\":[\"Yes\",\"No\"]}'),
