(427, 20, '{\"id\":427,\"name\":\"Was the work made by a broadcaster?\",\"title\":\"Was the work made by a broadcasting organization?\",\"type\":\"list\",\"information\":\"A broadcasting organisation is a private or state-owned company that produces television or radio programmes and broadcasts them or has them broadcasted under its responsibility, in accordance with the legislation of the country in which the broadcasting takes place.\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(428, 18, '{\"id\":428,\"name\":\"What type of work is this?\",\"title\":\"What type of publication is this?\",\"type\":\"list\",\"information\":\"Select \\\"Published book\\\" if the written work is a printed composition bound in a volume. Select \\\"Newspaper, journal or magazine\\\" if it is a printed publication intended for periodical publication and distribution (e.g. daily, monthly or yearly).\",\"outputs\":[\"Published book\",\"Newspaper, journal or magazine\"]}'),
