(431, 20, '{\"id\":431,\"name\":\"Was the work made by a Public Service Broadcaster?\",\"title\":\"Was the work made by a Public Service Broadcaster?\",\"type\":\"list\",\"information\":\"Public media institutions, including public service broadcasters are regulated by the Dutch Media Act. Please check the following table to determine if the broadcaster has been a public service one at the time the broadcast was made: http://diligentsearch.eu/wp-content/uploads/2017/06/Public-Service-Broadcasters-in-the-NL.pdf.\",\"outputs\":[\"Yes\",\"No\"]}'),
