(433, 20, '{\"id\":433,\"name\":\"Is the public service broadcaster still in business?\",\"title\":\"Is the public service broadcaster still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the broadcaster is still in business you may search for the broadcaster\'s details on an Internet search engine, such as http://www.google.com\",\"outputs\":[\"Yes\",\"No\"]}'),
(434, 20, '{\"id\":434,\"name\":\"Has the public service broadcaster been bought/ merged?\",\"title\":\"Has the public service broadcaster been bought by or merged with another organization?\",\"type\":\"list\",\"information\":\"Please \'add another answer\' below if the public service broadcaster has been bought/merged\",\"outputs\":[\"Yes\",\"No\"]}'),
(435, 20, '{\"id\":435,\"name\":\"Is the broadcaster a public service broadcaster?\",\"title\":\"Is the broadcaster a public service broadcaster?\",\"type\":\"list\",\"information\":\"Public-service broadcasters as provided for in the Dutch Media Act. Please check the following table to determine if the broadcaster has been a public service one at the time the broadcast was made: http://diligentsearch.eu/wp-content/uploads/2017/06/Public-Service-Broadcasters-in-the-NL.pdf\\n\",\"outputs\":[\"Yes\",\"No\"]}'),
(436, 20, '{\"id\":436,\"name\":\"Is any of the broadcasters above still in business?\",\"title\":\"Is any of the broadcasters above still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the broadcaster is still in business you may search for the broadcaster\'s details on an Internet search engine, such as http://www.google.com\",\"outputs\":[\"Yes\",\"No\"]}'),
(446, 21, '{\"id\":446,\"name\":\"Has the work been published?\",\"title\":\"Has the work been published?\",\"type\":\"list\",\"information\":\"A written work is considered to be \'published\' if copies of the work have been issued to the public or are made available to the public by means of an electronic retrieval system (such as an online on-demand service), either for commercial or non-commercial purposes. Public performance of the work, or communication of the work to the public otherwise than for the purpose of an electronic retrieval system, do not constitute \'publication\'. (See CDPA, § 175)\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(447, 21, '{\"id\":447,\"name\":\"Is the name of the publisher known?\",\"title\":\"Is the name of the publisher known?\",\"type\":\"list\",\"information\":\"The publisher is the person or the company responsible for the typographical design, edition, printing and distribution of the work to the public. The name of the publisher is usually found at the bottom of the title page and/or on the verso of the publication. If no such information is available, or if the written work has been printed and distributed by its author alone, then select “No”.\",\"outputs\":[\"Yes\",\"No\"]}'),
(448, 21, '{\"id\":448,\"name\":\"What is the name of the publisher?\",\"title\":\"What is the name of the publisher?\",\"type\":\"text\",\"information\":\"Add here the name of person or the company responsible for the typographical design, edition, printing and distribution of the written work, as resulting from the information available.\",\"outputs\":[\"Set\"]}'),
(449, 21, '{\"id\":449,\"name\":\"Is the publisher still in business?\",\"title\":\"Is the publisher still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the publisher is still in business you have to search for the publisher’s details on the relevant Chamber of Commerce or other specialistic online services, if known. You can also check on general Internet search engines, such as http://www.google.co.uk,  http://www.bing.com, https://uk.yahoo.com, or https://uk.ask.com\",\"outputs\":[\"Yes\",\"No\"]}'),
(450, 21, '{\"id\":450,\"name\":\"Has the publisher been bought by or merged with another publisher?\",\"title\":\"Has the publisher been bought by or merged with another publisher?\",\"type\":\"list\",\"information\":\"In order to find out whether the publisher has been bought by or merged with another publisher you may search for information on an Internet search engine, such as http://www.google.co.uk,  http://www.bing.com, https://uk.yahoo.com, or https://uk.ask.com. If the publisher has been bought by or merged with another publisher, please fill in the details of that other publisher using the \'add another answer\' button below.\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(451, 21, '{\"id\":451,\"name\":\"What are the publisher\'s contact details?\",\"title\":\"What are the publisher\'s contact details?\",\"type\":\"text\",\"information\":\"Add any valid contact details you found (address, telephone, e-mail, etc.) after searching all relevant sources, or leave this field blank.\",\"outputs\":[\"Set\"]}'),
(452, 21, '{\"id\":452,\"name\":\"Did you fill in any contact details of the publisher(s) above?\",\"title\":\"Did you fill in any contact details of the publisher(s) above?\",\"type\":\"list\",\"information\":\"\",\"outputs\":[\"Yes\",\"No - I haven\'t found any contact details\"]}'),
(453, 21, '{\"id\":453,\"name\":\"Is the name of the author known?\",\"title\":\"Is the name of the author known?\",\"type\":\"list\",\"information\":\"The \'author\' is the person who created the work (CDPA, § 9). In case of a derivative work, such as a translation or a dramatization of a novel, \'authors\' are both the person who created the original work and the one who created the derivative work. In case of a compilation, such as a collection of literary works, \'authors\' are both the person who created the collection and those who created the works contained in the compilation. An \'author\' can only be a natural person. Unless there is reason to believe differently, the author is the person whose name is indicated as the creator in or on the written work or, where there is no such indication, the person who was made known as the author when the written work was made public.\",\"outputs\":[\"Yes\",\"No\"]}'),
(454, 21, '{\"id\":454,\"name\":\"What is the name of the author?\",\"title\":\"What is the name of the author?\",\"type\":\"text\",\"information\":\"Please enter the full name of the author.\",\"outputs\":[\"Set\"]}'),
(455, 21, '{\"id\":455,\"name\":\"Is there any evidence that the work was not created by this author?\",\"title\":\"Is there any evidence that the work was not created by this author?\",\"type\":\"list\",\"information\":\"Please indicate if there is any evidence that the author is not the person whose name is indicated in the written work.\",\"outputs\":[\"Yes\",\"No\"]}'),
(456, 21, '{\"id\":456,\"name\":\"Is the author still alive?\",\"title\":\"Is the author still alive?\",\"type\":\"list\",\"information\":\"Respond to this question to the best of your knowledge, after having consulted the relevant sources if necessary.\",\"outputs\":[\"Yes\",\"No\",\"Unknown\"]}'),
(457, 21, '{\"id\":457,\"name\":\"If the author is no longer alive, are the author\'s heirs known?\",\"title\":\"If the author is no longer alive, are the author\'s heirs known?\",\"type\":\"list\",\"information\":\"Copyright passes by succession. If the author is deceased, his rights can be passed to his heirs. The search results in the sources will also need to include the heirs’ names, if known.\",\"outputs\":[\"Yes\",\"No\"]}'),
(458, 21, '{\"id\":458,\"name\":\"What are the author\'s or his heirs\' contact details?\",\"title\":\"What are the author\'s or his heirs\' contact details?\",\"type\":\"text\",\"information\":\"Add any valid contact details you found (address, telephone, e-mail, etc.) after searching all relevant sources, or leave this field blank.\",\"outputs\":[\"Set\"]}'),
(459, 21, '{\"id\":459,\"name\":\"Did you add any of the author(s)\'s contact details above?\",\"title\":\"Did you add any of the author(s)\'s contact details above?\",\"type\":\"list\",\"information\":\"\",\"outputs\":[\"Yes\",\"No - I haven\'t found any contact details\"]}'),
(460, 21, '{\"id\":460,\"name\":\"Does the work contain images or art work?\",\"title\":\"Does the work contain images or art work?\",\"type\":\"list\",\"information\":\"A written work can, as part of its content, contain other copyright-protected works made by other creators than the author. These can be photographs or graphic works such as drawings, diagrams, maps, charts, plans, engravings or lithographs (CDPA, § 4)\",\"outputs\":[\"Yes\",\"No\"]}'),
(461, 21, '{\"id\":461,\"name\":\"Is the art work a photograph, engraving or a potrait?\",\"title\":\"Is the art work a photograph, engraving or a potrait?\",\"type\":\"list\",\"information\":\"A \'photograph\' is a recording of light or other radiation (such as x-ray) on any medium. Single frames of films are not \'photographs\'.\\nAn \'engraving\' is a representation made by incision on a surface and include etchings, lithograph, woodcut, print and other similar works.\\nA \'portrait\' include all methods of pictorial representation of a person\'s likeness.\",\"outputs\":[\"Yes\",\"No\"]}');
