(463, 21, '{\"id\":463,\"name\":\"Was the work commissioned?\",\"title\":\"Was the work commissioned?\",\"type\":\"list\",\"information\":\"A work is \'commissioned\' if it was made in pursuance to a contract of commission, i.e. a written or oral agreement to create a work in exchange of a payment. Under the copyright law in force until 1/8/1989, a person who commissioned the taking of a photograph or the painting or drawing of a portrait was entitled to any copyright subsisting in the commissioned work (Copyright Act 1956, § 4(3) and Copyright Act 1911, § 5(1)(a)).\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(464, 21, '{\"id\":464,\"name\":\"Is the name of the commissioner known?\",\"title\":\"Is the name of the commissioner known?\",\"type\":\"list\",\"information\":\"The \'commissioner\' is the person or the company who commissioned the work.\",\"outputs\":[\"Yes\",\"No\"]}'),
