(468, 21, '{\"id\":468,\"name\":\"If the commissioner is a company, has the company been bought or merged with another company?\",\"title\":\"If the commissioner is a company, has the company been bought or merged with another company?\",\"type\":\"list\",\"information\":\"In order to find out whether the company has been bought by or merged with another company you may search for information on an Internet search engine, such as http://www.google.co.uk,  http://www.bing.com, https://uk.yahoo.com, or https://uk.ask.com. If the company has been bought by or merged with another company, please fill in the details of that other company using the \'add another answer\' button below.\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
