(472, 21, '{\"id\":472,\"name\":\"Did you add contact information about a commissioner above?\",\"title\":\"Did you add contact information about a commissioner above?\",\"type\":\"list\",\"information\":\"\",\"outputs\":[\"Yes\",\"No - I haven\'t found any contact details\"]}'),
(473, 21, '{\"id\":473,\"name\":\"Is the name of the artist known?\",\"title\":\"Is the name of the artist known?\",\"type\":\"list\",\"information\":\"The artist is the person who created the image (photograph or graphic work) contained in the written work. If the image is the reproduction of another art work (for instance: a photograph of a painting, a sculpture or a building) you must indicate, separately, the creator of the image and the creator of the art work.\",\"outputs\":[\"Yes\",\"No\"]}'),
