(485, 23, '{\"id\":485,\"name\":\"Is the sound recording made by a broadcaster?\",\"title\":\"Is the sound recording made by a broadcaster?\",\"type\":\"list\",\"information\":\"A broadcasting organisation is a private or state-owned company that produces television or radio programmes and broadcasts them or has them broadcasted under its responsibility, in accordance with the legislation of the country in which the broadcasting takes place.\",\"outputs\":[\"Yes\",\"No\"]}'),
(486, 22, '{\"id\":486,\"name\":\"is it a film work?\",\"title\":\"Is it a film work?\",\"type\":\"list\",\"information\":\"A \'film work\' is an audiovisual production which reflects the creative choices of one of more individuals. Feature films, documentaries, TV programmes, commercials, home videos and the like are all \'film works\', irrespective of their length and artistic or technical quality. Audiovisual products deprived of any individual character, such as CCTV footage and purely technical recordings, are not \'film works\'. \",\"outputs\":[\"Yes\",\"No\"]}'),
(487, 22, '{\"id\":487,\"name\":\"Has the work been published?\",\"title\":\"Has the work been published?\",\"type\":\"list\",\"information\":\"An audiovisual work is considered published if copies of the work have been sold or let on hire to the general public before 1 August 1989 (Copyright Act 1956, § 13(10), or if they have been otherwise made available to the public, in tangible or intangible form, after that date. Showing the audiovisual in public does not constitute \'publication\', nor does its communication to the public (broadcasting and making available on-demand) (CDPA 1988, § 175(4)(c)).\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(488, 22, '{\"id\":488,\"name\":\"Is the name of the distributor known?\",\"title\":\"Is the name of the distributor known?\",\"type\":\"list\",\"information\":\"The distributor is the person or the company which markets the film and is responsible for its distribution to the public. Distribution may include: theatrical release, non-theatrical exhibition (e.g. airlines, ships, hotel rooms), TV broadcasting, home-video sale and rental (VHS, DVD, etc.) and online distribution (video-on-demand). Usually the distributor is distinct from the producer, but for some film productions they might be the same.\",\"outputs\":[\"Yes\",\"No\"]}'),
(489, 22, '{\"id\":489,\"name\":\"What is the name of the distributor?\",\"title\":\"What is the name of the distributor?\",\"type\":\"text\",\"information\":\"Add the name of the person or company.\",\"outputs\":[\"Set\"]}'),
(490, 22, '{\"id\":490,\"name\":\"Is the distributor still in business?\",\"title\":\"Is the distributor still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the distributor is still in business you may search for the distributor\'s details on a general search engine, such as http://www.google.co.uk, http://www.bing.com, https://uk.yahoo.com or https://uk.ask.com\",\"outputs\":[\"Yes\",\"No\",\"Unknown\"]}'),
(491, 22, '{\"id\":491,\"name\":\"What are the distributor\'s contact details?\",\"title\":\"What are the distributor\'s contact details?\",\"type\":\"text\",\"information\":\"Add the contact details of the distributor or those of the Organization that manages his rights, if known. If you could not find any details after searching all relevant sources, then leave this field blank.\",\"outputs\":[\"Set\"]}'),
(492, 22, '{\"id\":492,\"name\":\"Has the distributor been bought or merged?\",\"title\":\"Has the distributor been bought or merged?\",\"type\":\"list\",\"information\":\"You may search for this information on a general search engine, such as http://www.google.co.uk http://www.bing.com https://uk.yahoo.com or https://uk.ask.com If the distributor has been bought by or merged with another company, please fill in the details of that other company using the \'add another answer\' button below.\",\"outputs\":[\"Yes\",\"No\",\"Unknown\"]}'),
(493, 22, '{\"id\":493,\"name\":\"Did you fill in any contact details of the distributor(s) above?\",\"title\":\"Did you fill in any contact details of the distributor(s) above?\",\"type\":\"list\",\"information\":\"\",\"outputs\":[\"Yes\",\"No - I haven\'t found any details\"]}'),
(494, 22, '{\"id\":494,\"name\":\"Is the name of the producer known?\",\"title\":\"Is the name of the producer known?\",\"type\":\"list\",\"information\":\"The producer is the person or the company who makes the technical and financial arrangements necessary for the making of the audiovisual work. Depending on the kind of audiovisual work, \'production\' may include activities such as casting, set building, photography, editing, dubbing and recording. In case of a film work, the producer or production company is often mentioned prominently in the opening or closing credits of the film.\",\"outputs\":[\"Yes\",\"No\"]}'),
(495, 22, '{\"id\":495,\"name\":\"What is the name of the producer?\",\"title\":\"What is the name of the producer?\",\"type\":\"text\",\"information\":\"Add the name of the person or company.\",\"outputs\":[\"Set\"]}'),
(496, 22, '{\"id\":496,\"name\":\"Is there any evidence that the work has not been made by this producer?\",\"title\":\"Is there any evidence that the work has not been made by this producer?\",\"type\":\"list\",\"information\":\"Please indicate if there is any evidence that the producer is not the person or the company whose name is indicated in or on the audiovisual work.\",\"outputs\":[\"Yes\",\"No\"]}'),
