(498, 22, '{\"id\":498,\"name\":\"If the producer is not a company, is the producer still alive?\",\"title\":\"If the producer is not a company, is the producer still alive?\",\"type\":\"list\",\"information\":\"Respond to this question to the best of your knowledge, after having consulted the relevant sources if necessary.\",\"outputs\":[\"Yes\",\"No\",\"Unknown\"]}'),
(499, 22, '{\"id\":499,\"name\":\"Are the producer\'s heirs known?\",\"title\":\"If the producer is not a company and is no longer alive, are the producer\'s heirs known?\",\"type\":\"list\",\"information\":\"Copyright passes by succession. If the producer is deceased, his rights can be passed to his heirs. The search results in the sources will also need to include the heirs’ names, if known.\",\"outputs\":[\"Yes\",\"No\"]}'),
