(501, 22, '{\"id\":501,\"name\":\"Has the production company been bought or merged with another producer?\",\"title\":\"If the producers is a company, has the production company been bought or merged with another producer?\",\"type\":\"list\",\"information\":\"You may search for this information on a general search engine, such as http://www.google.co.uk, http://www.bing.com, https://uk.yahoo.com, or https://uk.ask.com. If the company has been bought by or merged with another company, please fill in the details of that other company using the \'add another answer\' button below.\",\"outputs\":[\"Yes\",\"No\"]}'),
