(536, 23, '{\"id\":536,\"name\":\"Has the phonogram been published?\",\"title\":\"Has the phonogram been published?\",\"type\":\"list\",\"information\":\"A sound recording has been \'published\' if copies of the recording have been issued to the public, either for commercial or non-commercial purposes. Playing a sound recording in public does not constitute \'publication\', nor does its communication to the public (CDPA 1988, § 175(4)(c)).\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
(537, 23, '{\"id\":537,\"name\":\"Is the name of content publisher known?\",\"title\":\"Is the name of content publisher known?\",\"type\":\"list\",\"information\":\"In case of sound recordings of music, the content publisher is the record label. In case of sound recordings of literary or dramatic works, the content publisher is the publisher of the underlying literary or dramatic work. If the phonogram is not a sound recording of a published work (for instance it is a recording of an oral speech or an improvised live performance), then there is no content publisher.\",\"outputs\":[\"Yes\",\"No\"]}'),
