(539, 23, '{\"id\":539,\"name\":\"Is the content publisher still in business?\",\"title\":\"Is the content publisher still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the publisher is still in business you have to search for the publisher’s details on an Internet search engine, such as http://www.google.co.uk http://www.bing.com https://uk.yahoo.com or https://uk.ask.com\",\"outputs\":[\"Yes\",\"No\"]}'),
