(634, 20, '{\"id\":634,\"name\":\"Has the work been published?\",\"title\":\"Has the work been published?\",\"type\":\"list\",\"information\":\"An audiovisual work is considered published if it has been provided to the public somehow, in tangible or intangible form, with the authorization of the copyright owner. Publication include theatrical and non-theatrical screening, broadcasting, home-video distribution (VHS, DVD, etc.), dissemination through the Internet.\",\"outputs\":[\"Yes\",\"No or unknown\"]}'),
