(682, 24, '{\"id\":682,\"name\":\"Has the work been published?\",\"title\":\"Has the work been published?\",\"type\":\"list\",\"information\":\"A written work is considered to be \'published\' if the work has been made available to the public by any means either for commercial or non-commercial purposes. Publication is considered to be the first exercise of the authors\' right (See art. 12, Italian Copyright Law, hereinafter \'ICL\' )\",\"outputs\":[\"Yes\",\"No\"]}'),
(683, 24, '{\"id\":683,\"name\":\"Is the name of the publisher known?\",\"title\":\"Is the name of the publisher known?\",\"type\":\"list\",\"information\":\"The publisher is the person or the company responsible for the typographical design, edition, printing and distribution of the work to the public. The name of the publisher is usually found at the bottom of the title page and/or on the verso of the publication. If such information is not available, or if the written work has been printed and distributed by its author alone, then select “No”.\",\"outputs\":[\"Yes\",\"No\"]}'),
(684, 24, '{\"id\":684,\"name\":\"What is the name of the publisher?\",\"title\":\"What is the name of the publisher?\",\"type\":\"text\",\"information\":\"Add here the name of person or the company responsible for the typographical design, edition, printing and distribution of the written work, as resulting from the information available.\",\"outputs\":[\"Set\"]}'),
(685, 24, '{\"id\":685,\"name\":\"Is the publisher still in business?\",\"title\":\"Is the publisher still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the publisher is still in business the most reliable source is http://www.registroimprese.it/, where it is possible to find all the information  related to the past and present activity of any legal person. In alternative, it is possible to search for the publisher’s details through the most popular Internet search engine, such as http://www.google.it,  http://www.bing.com.\",\"outputs\":[\"Yes\",\"No\"]}'),
