(692, 24, '{\"id\":692,\"name\":\"Is the name of the author known?\",\"title\":\"Is the name of the author known?\",\"type\":\"list\",\"information\":\"The \'author\' is the natural person who created the work, whereas legal persons cannot be beneficiaries of copyright. (art. 6 ICL). A natural person can be beneficiary of copyright only if the work (which must be creative and novel) is expressed. In case of joint works, singular nature collective works and composite works there is more than one author.  As a general rule the author of the derivative work enjoys copyright as long as his original contribution is clearly distinguishable. For joint works there is joint copyright whose beneficiary is each creator. For composite works related to a new creation all the contributors enjoy joint copyright on the new work . When each contribution is distingushable every author is beneficiary of a separate right. The editor has a separate copyright on the collection itself.  Unless there is reason to believe differently, the author is the person whose name is indicated as the creator in or on the written work or, where such indication is not available, the person who was made known as the author when the written work was made public.\",\"outputs\":[\"Yes\",\"No\"]}'),
(693, 24, '{\"id\":693,\"name\":\"What is the name of the author?\",\"title\":\"What is the name of the author?\",\"type\":\"text\",\"information\":\"Please enter the full name of the author.\",\"outputs\":[\"Set\"]}'),
