(699, 24, '{\"id\":699,\"name\":\"Does the work contain images or art work?\",\"title\":\"Does the work contain images or art work?\",\"type\":\"list\",\"information\":\"A written work can, as part of its content, contain other copyright-protected works made by other creators than the author. These can be photographs or graphic works such as drawings, diagrams, maps, charts, plans, engravings or lithographs. \",\"outputs\":[\"Yes\",\"No\"]}'),
(700, 24, '{\"id\":700,\"name\":\"Is the name of the artist known?\",\"title\":\"Is the name of the artist known?\",\"type\":\"list\",\"information\":\"The artist is the person who created the image (photograph or graphic work) contained in the written work. If the image is the reproduction of another art work (for instance: a photograph of a painting, a sculpture or a building) you must indicate, separately, the creator of the image and the creator of the art work.\",\"outputs\":[\"Yes\",\"No\"]}'),
