(760, 25, '{\"id\":760,\"name\":\"Was the work made by RAI?\",\"title\":\"Was the work made by RAI?\",\"type\":\"list\",\"information\":\"A broadcasting organisation is a private or state-owned company that produces television or radio programmes and broadcasts them or has them broadcasted under its responsibility, in accordance with the legislation of the country in which the broadcasting takes place. Please indicate which broadcaster made this work. Indicate if there is any evidence that this work is not made by this broadcaster. If this is the case add the broadcaster that actually made this work by using the \'add another answer\' below. The RAI - Radiotelevisione Italiana SpA , (often abbreviated as RAI) is the company in charge exclusively of the Italian public service broadcasting. The Royal Decree no. 1067/1923, entrusted the State with the exclusivity on radio transmissions to be exercised through concession companies. Thus, on 27 August 1924 he was born the  Italian Radio Union ( URI ) in the form of a limited company. In 1927 the URI was transformed into the Italian Radio Broadcasting Authority (EIAR), remaining in private hands. In 1944 , Radio Audizioni Italiane was born and lately the shares were bought by the Ministery of Communications. In 1954, Radio Audizioni Italiane, following the launch of regular television broadcasts (on 3 January 1954 ), became Rai - Radiotelevisione Italiana SpA. Last step was the merger in 2004 of Rai Holding SpA (which held the relative majority of Rai shares) with Rai SpA forming the present company. In 1995, a popular referendum was held and the exclusive possession of Rai shares was reserved to the public hands.  \",\"outputs\":[\"Yes\",\"No\"]}'),
(761, 25, '{\"id\":761,\"name\":\"Has the phonogram been published?\",\"title\":\"Has the phonogram been published?\",\"type\":\"list\",\"information\":\"The ICL does not provide for a precise definition of \'publication\' for each work. Generally speaking, \'publication\' is exercised by making available the work to the general public (for example through the execution or the representation in public or its communication to the public) either for commercial or non-commercial purposes. Publication is considered to be the first exercise of the authors\' right (art 12 ICL).\",\"outputs\":[\"Yes\",\"No\"]}'),
