(764, 25, '{\"id\":764,\"name\":\"Is the name of content publisher known?\",\"title\":\"Is the name of content publisher known?\",\"type\":\"list\",\"information\":\"In case of sound recordings of music, the content publisher is the record label. In case of sound recordings of literary or dramatic works, the content publisher is the publisher of the underlying literary or dramatic work. If the phonogram is not a sound recording of a published work (for instance it is a recording of an oral speech or an improvised live performance), then there is no content publisher.\",\"outputs\":[\"Yes\",\"No\"]}'),
