(770, 25, '{\"id\":770,\"name\":\"Is the name of the sound recording producer known?\",\"title\":\"Is the name of the sound recording producer known?\",\"type\":\"list\",\"information\":\"The producer is the natural person or the company who is in charge of the first fixation of the sounds coming from the interpretation or the execution. He can be in charge also of the fixation of sounds originating from other sounds or representation of sounds (art. 78 ICL). He is beneficiary of neighbouring rights such as the right to authorize the (direct or indirect) reproduction, temporary or permanent of his phonograms, whatever the duplication process concerned. He also has the right to authorize the distribution of his phonograms, the rental and all the activities aimed to make his phonograms available to the public (art. 72 ICL).\",\"outputs\":[\"Yes\",\"No\"]}'),
