(776, 25, '{\"id\":776,\"name\":\"Is the name of the performer known?\",\"title\":\"Is the name of the performer known?\",\"type\":\"list\",\"information\":\"The \'performer\' is the actor, singer, musician, or any other person who delivers a performance of a literary, dramatic or musical work. \'Performance\' include dramatic performance, musical performance, reading or recitation of a literary work or a performance of a variety of act or any similar presentation (art. 82 ICL). The \'performer\' can be a person or a a group of persons, such as a band or an orchestra, having a particular name by which it can be identified collectively. Art. 82 ICL provides a non-exhaustive list of persons. According to the list provided by art. 82 ICL, are considered to be artists and performers 1) those who play a considerable role in the work; 2) the conductor; 3) orchestras or choirs, provided that their work has an autonomous artistic value and it cannot just be considered as musical accompaniment.\",\"outputs\":[\"Yes\",\"No\"]}'),
