(812, 26, '{\"id\":812,\"name\":\"Is it a film work?\",\"title\":\"Is it a film work?\",\"type\":\"list\",\"information\":\"A \'film work\' is an audiovisual production which reflects the creative choices of one of more individuals. The legal nature of the work is controversial. It is considered to be either a collective work or a composite work. It is a work constituted by one or more sequences of scenes, actions and images and it is aimed to be projected or shawn in pubblic. The creative process is formed by the following steps: the elaboration of a subject, the creation of the script  (literary elaboration of the subject), filming and mounting. The process ends with the approval of all the described steps. (artt. 44-50 ICL). TV films, documentaries and short films, videoclips, new audiovisual forms aimed to be broadcast through home video circuits, on demand or streaming are considered to be film works. The evolution of technologies has brought to new cultural audiovisual products, broadly defined as audiovisual works (e.g. video clips, reality shows, format of tv programms). Audiovisual works are comprised in the traditional category of film works. According to Italian law the norms for the protection of film works are extensively applicable to audio-visual works. Audio-visual products that do not possess a certain level of originality and creativity (as to show the personal author\'s representation of reality) are excluded from the protection according to Italian copyright law. Anyway, this should be assessed on a case by case basis. If they are not considered creative and original, they are protected by neighbouring rights.   According to art. 44 ICL the author of the subject, the author of the script and the author of the music as the art director are considered to be co-authors of the work. There are two creative steps that should be considered: firslty the creation of each work that is aimed to be merged together in the film work and secondly the merging phase. The director is the person that coordinates and performs the  merging of all the contributionsof the single authors in the collective/composite work (art. 7 e art. 38 ICL). \",\"outputs\":[\"Yes\",\"No\"]}'),
(813, 26, '{\"id\":813,\"name\":\"Was the work made until 31 December 2002?\",\"title\":\"Was the work made before 31 December 2002?\",\"type\":\"numeric\",\"information\":\"Works produces before the 31  december 2002 are also considered those commissioned by public owned boradcasters for their exclusive use or for the exclusive use of other co-producers broadcasters.\",\"numerical\":{\"refId\":16,\"condition\":\">\",\"expression\":[{\"source\":\"userInputs\",\"dataId\":42}],\"operations\":[]},\"outputs\":[\"Yes\",\"No\"]}'),
(815, 26, '{\"id\":815,\"name\":\"Is the name of the producer known?\",\"title\":\"Is the name of the producer known?\",\"type\":\"list\",\"information\":\"The producer is the person or the company who makes the technical and financial arrangements necessary for the making of the audiovisual work. In case of a film work, the producer or production company is often mentioned prominently in the opening or closing credits of the film. The producer is beneficiary of neighbouring rights according to art. 78 ter ILC.\",\"outputs\":[\"Yes\",\"No\"]}'),
