(824, 26, '{\"id\":824,\"name\":\"Is the name of the director known?\",\"title\":\"Is the name of the director known?\",\"type\":\"list\",\"information\":\"The director is the person who has creative control over the making of the film and is responsible for creative choices such as were to point the camera and deciding the camera settings. The director is a natural person and cannot be a company. In case of a film production, his or her name is usually one of the most prominent credits in the film. \",\"outputs\":[\"Yes\",\"No\"]}'),
