(828, 26, '{\"id\":828,\"name\":\"Are the director\'s heirs known?\",\"title\":\"If the director is no longer alive, are the director\'s heirs known?\",\"type\":\"list\",\"information\":\"Copyright passes by succession. If the director is deceased, his rights can be passed to his heirs. The search results in the sources will also need to include the heirs’ names, if known.\",\"outputs\":[\"Yes\",\"No\"]}'),
