(831, 26, '{\"id\":831,\"name\":\"Is the name of the script writer known?\",\"title\":\"Is the name of the script writer known?\",\"type\":\"list\",\"information\":\"The script writer is the author of the screenplay for the film. His or her name usually features in the credits of the film. If the screenplay is not original, but is based on a pre-existing work (such as a novel, a drama or another film), you must carry out a separate diligent search for the pre-existing work.\",\"outputs\":[\"Yes\",\"No\"]}'),
