(845, 26, '{\"id\":845,\"name\":\"Is the name of the composer of the music of the film known?\",\"title\":\"Is the name of the composer of the music of the film known?\",\"type\":\"list\",\"information\":\"This is the composer of either the original soundtrack or of the music which features in the film. Music which is only incidentally included in the audiovisual production (for instance, a background music in a TV documentary) should not be considered. The name of the composer is usually indicated in the credits of the film.\",\"outputs\":[\"Yes\",\"No\"]}'),
