(852, 24, '{\"id\":852,\"name\":\"If the author is no longer alive, are the author\'s heirs known?\",\"title\":\"If the author is no longer alive, are the author\'s heirs known?\",\"type\":\"list\",\"information\":\"Copyright passes by succession. If the author is deceased, his rights can be passed to his heirs. \",\"outputs\":[\"Yes, they are known\",\"No, they are not known\"]}'),
