(855, 24, '{\"id\":855,\"name\":\"Was the work commissioned?\",\"title\":\"Was the work commissioned?\",\"type\":\"list\",\"information\":\"The work is generally commissioned by virtue of a contract. It can be either a self employment contract or a dependent employment contract. In the case of the self employment contract the commissioner is the beneficiary of copyright on the work that has been created within the limit of the specific contractual provisions (art. 2222 Italian Civil Code). The commissioner has copyright from the moment of the acceptance (not instead from the moment of the creation of the work).\",\"outputs\":[\"Yes, it was. \",\"No, it wasn\'t. \"]}'),
(856, 24, '{\"id\":856,\"name\":\"Is the name of the commissioner known?\",\"title\":\"Is the name of the commissioner known?\",\"type\":\"list\",\"information\":\"The \'commissioner\' is the person or the company who commissioned the work.\",\"outputs\":[\"Yes\",\"No\"]}'),
(857, 24, '{\"id\":857,\"name\":\"What is the name of the commissioner?\",\"title\":\"What is the name of the commissioner?\",\"type\":\"text\",\"information\":\"Please enter the full name of the commissioner.\",\"outputs\":[\"Set\"]}'),
