(859, 24, '{\"id\":859,\"name\":\"If the commissioner is a company, is the company still in business?\",\"title\":\"If the commissioner is a company, is the company still in business?\",\"type\":\"text\",\"information\":\"In order to find out whether the company is still in business the most reliable source is http://www.registroimprese.it/ where it is possible to find all the information  related to the past and present activity of any legal person. In alternative, it is possible to search for the publisher’s details on the most popular Internet search engines, such as http://www.google.it,  http://www.bing.com.\",\"outputs\":[\"Set\"]}'),
(860, 24, '{\"id\":860,\"name\":\"If the commissioner is a company, has the company been bought or merged with another company?\",\"title\":\"If the commissioner is a company, has the company been bought or merged with another company?\",\"type\":\"text\",\"information\":\"In order to find out whether the company has been bought by or merged with another company the most reliable source is http://www.registroimprese.it/, where it is possible to find all the information  related to the past and present activity of any legal persons. In alternative, it is possible to search for the publisher’s details on the most popular Internet search engines, such as http://www.google.it,  http://www.bing.com\",\"outputs\":[\"Set\"]}'),
