(865, 24, '{\"id\":865,\"name\":\"Is the art work a photograph, engraving or a potrait?\",\"title\":\"Is the art work a photograph, engraving or a potrait?\",\"type\":\"text\",\"information\":\"A \'photograph\' is a recording of light or other radiation (such as x-ray) on any medium. Single frames of films are taken before, during or after the filming/mounting phase. As for their documentary function, they are considered as simple photographs (photographs which do not possess a relevant degree of creativity) and their are protected by neighbouring rights.  An \'engraving\' is a representation made by incision on a surface and include etchings, lithograph, woodcut, print and other similar works. A \'portrait\' include all methods of pictorial representation of a person\'s likeness.\",\"outputs\":[\"Set\"]}'),
(878, 26, '{\"id\":878,\"name\":\"If the script writer is no longer alive, are the script writer\'s heirs known?\",\"title\":\"If the script writer is no longer alive, are the script writer\'s heirs known?\",\"type\":\"list\",\"information\":\"Copyright passes by succession. If the author is deceased, his rights can be passed to his heirs. The search results in the sources will also need to include the heirs’ names, if known.\",\"outputs\":[\"Yes\",\"No\",\"Third choice\"]}'),
(879, 26, '{\"id\":879,\"name\":\"Is the name of the author of dialogues known?\",\"title\":\"Is the name of the author of dialogues known?\",\"type\":\"list\",\"information\":\"The author of dialogues is the writer of the dialogue of films only. If this is not specifically credited in the opening or closing titles of the film, one can assume that the dialogue\'s author is the same person as the script writer.\",\"outputs\":[\"Yes\",\"No\"]}'),
(880, 26, '{\"id\":880,\"name\":\"If the author of the dialogues is no longer alive, are the author of the dialogue\'s heirs known?\",\"title\":\"If the author of the dialogues is no longer alive, are the author of the dialogue\'s heirs known?\",\"type\":\"list\",\"information\":\"Copyright passes by succession. If the author is deceased, his rights can be passed to his heirs. The search results in the sources will also need to include the heirs’ names, if known.\",\"outputs\":[\"Yes\",\"No\"]}'),
