(882, 26, '{\"id\":882,\"name\":\"Is there any evidence that the work has not been made by this broadcaster?\",\"title\":\"Is there any evidence that the work has not been made by this broadcaster?\",\"type\":\"list\",\"information\":\"If there is evidence that this work has not been made by this broadcaster please add the broadcaster that did make this work below using the \'add another answer\' button.\",\"outputs\":[\"Yes\",\"No\"]}'),
(884, 26, '{\"id\":884,\"name\":\"Has the work been published?\",\"title\":\"Has the work been published?\",\"type\":\"list\",\"information\":\"The ICL doesn not provide for a precise definition of \\\"publication\\\" for each work. Generally speaking, \\\"publication\\\" is the activity through which the work is made available to the general public (for example through the execution or the representation in public or its communication to the public) either for commercial or non commercial purposes. Publication is considered to be the first exsercise of the authors\' right (art 12 ICL).\",\"outputs\":[\"Yes\",\"No\"]}'),
(885, 26, '{\"id\":885,\"name\":\"Is the name of the distributor known?\",\"title\":\"Is the name of the distributor known?\",\"type\":\"list\",\"information\":\"The distributor is the person or the company which markets the film and is responsible for its distribution to the public. Distribution may include: theatrical release, non-theatrical exhibition (e.g. airlines, ships, hotel rooms), TV broadcasting, home-video sale and rental (VHS, DVD, etc.) and online distribution (video-on-demand). Usually the distributor is distinct from the producer, but for some film productions they might be the same.\",\"outputs\":[\"Yes\",\"No \"]}'),
(886, 26, '{\"id\":886,\"name\":\"What is the name of the distributor?\",\"title\":\"What is the name of the distributor?\",\"type\":\"text\",\"information\":\"Add the name of the person or company.\",\"outputs\":[\"Set\"]}'),
(887, 26, '{\"id\":887,\"name\":\"Is the distributor still in business?\",\"title\":\"Is the distributor still in business?\",\"type\":\"list\",\"information\":\"In order to find out whether the distributor is still in business  the most reliable source is http://www.registroimprese.it/ where it is possible to find all the information  related to the past and present activity of any legal person. In alternative, it is possible to search for the publisher’s details on the most popular Internet search engines, such as http://www.google.it,  http://www.bing.com.\",\"outputs\":[\"Yes\",\"No \"]}'),
