(889, 26, '{\"id\":889,\"name\":\"Has the distributor been bought or merged?\",\"title\":\"Has the distributor been bought or merged?\",\"type\":\"list\",\"information\":\"Audiovisual works\\tHas the distributor been bought or merged?\\tYou may search for this information on  http://www.registroimprese.it/ where it is possible to find all the information  related to the past and present activity of any legal person. In alternative, it is possible to search for the publisher’s details on the most popular Internet search engines, such as http://www.google.it,  http://www.bing.com.\\n\",\"outputs\":[\"Yes\",\"No\"]}'),
